function Navbar() {
  return (
    <div className="navigation_bar">
      <ul className="navbar">
        <li><a>Home</a></li>
        <li><a>Contact Us</a></li>
        <li><a>About Us</a></li>
      </ul>
    </div>
  );
}

export default Navbar;
